#   {name: "Bailey", email: "bailey@example.com", password_digest: "$2a$12$SoPOJqgYgAub9.LUeCEsMeN0.augDIhJu52xn7VIzNNtaDbp9z9yi", image: "https://i.guim.co.uk/img/media/48969322d7c394dee4e0acea35f722b60f3d6853/0_918_2655_1593/master/2655.jpg?width=1200&height=900&quality=85&auto=format&fit=crop&s=7fbe6b607ca2a67fd8ad368b6165c96e", about: "\nIntroducing Bailey Karfunkel, a conscientious individual bringing both style and compassion to our consignment store. Bailey has a remarkable dedication to giving back, making their mark in the world of fashion with a heart that beats for sustainability.\n\nAs a seller on our platform, Bailey finds joy in the journey of their old clothing. Instead of bidding farewell, they embrace the opportunity to see their cherished pieces find new homes and purposes. Bailey's commitment goes beyond the transaction; it's a commitment to promoting a greener, more sustainable approach to fashion.\n\nIn Bailey's consignment closet, each item tells a storyâ€”a story of love for fashion and a dedication to the community. The garments they share aren't just articles of clothing; they are vessels of positive change, contributing to a circular fashion economy that values both style and responsibility.\n\nShop Bailey Karfunkel's collection and join in the celebration of giving back. It's more than fashion; it's a statement of sustainability, a testament to the beauty of reusing and repurposing, and a shared commitment to making a positive impact, one stylish piece at a time.", last_name: "Karfunkel"},
